import React, { useState } from "react";
import "./App.css";

// Import components
import DashboardOverview from './Components/DashboardOverview';
import GeospatialMap from './Components/GeospatialMap';
import ChartsGraphs from './Components/ChartsGraphs';
import ISPLeaderboard from './Components/ISPLeaderboard';
import HistoryAnalysis from '/.Components/HistoryAnalysis';

function App() {
  const [activeComponent, setActiveComponent] = useState('DashboardOverview');
  const [isSidebarOpen, setSidebarOpen] = useState(true);

  const renderComponent = () => {
    switch (activeComponent) {
      case 'DashboardOverview':
        return <DashboardOverview />;
      case 'GeospatialMap':
        return <GeospatialMap />;
      case 'ChartsGraphs':
        return <ChartsGraphs />;
      case 'ISPLeaderboard':
        return <ISPLeaderboard />;
      case 'HistoryAnalysis':
        return <HistoryAnalysis />;
      default:
        return <DashboardOverview />;
    }
  };

  return (
    <div className="app-container">
      {isSidebarOpen && (
        <div className="sidebar">
          <button className="nav-button" onClick={() => setActiveComponent('DashboardOverview')}>Dashboard Overview</button>
          <button className="nav-button" onClick={() => setActiveComponent('GeospatialMap')}>Geospatial Map</button>
          <button className="nav-button" onClick={() => setActiveComponent('ChartsGraphs')}>Charts & Graphs</button>
          <button className="nav-button" onClick={() => setActiveComponent('ISPLeaderboard')}>ISP Leaderboard</button>
          <button className="nav-button" onClick={() => setActiveComponent('HistoryAnalysis')}>History Analysis</button>
        </div>
      )}
      <div className="main-content">
        <header className="header">
          <button className="toggle-sidebar-btn" onClick={() => setSidebarOpen(!isSidebarOpen)}>
            {isSidebarOpen ? 'Close Sidebar' : 'Open Sidebar'}
          </button>
        </header>
        <div className="chat-area">
          {renderComponent()}
        </div>
      </div>
    </div>
  );
}

export default App;
